import './App.css';
import Navbar from './components/Navbar';
import Home from './components/Home';
import About from './components/About';
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
function App() {
  return (
   <>

    <Navbar/>

    <BrowserRouter>
    <Routes>

      <Route exact path="/" element = {<Home/>}/>

      <Route exact path="/about" element = {<About/>}/>

    </Routes>
  </BrowserRouter>

   </>
  );
}

export default App;
